// src/App.js
import React from "react";
import SideNav from "./components/sidenav";

function App() {
  return (
    <div className="flex flex-col w-3/4 mx-auto my-12 items-center">
      <SideNav />
      <div className="flex w-2/3 mx-auto">Some page content</div>
    </div>
  );
}

export default App;
